pragma solidity 0.5.3;

import './Exc.sol';
// import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/solc-0.6/contracts/math/SafeMath.sol";
import '../contracts/libraries/math/SafeMath.sol';

contract Pool {
    address public factory;
    address public tokenP;
    address public token1;
    address public dex;
    bytes32 public tokenPT;
    bytes32 public token1T;



    function initialize(address _token0, address _token1, address _dex, uint whichP, bytes32 _tickerQ, bytes32 _tickerT) external {
        require(msg.sender == factory, 'Only factory contract can create a pool');
        if (whichP == 1) {
            tokenP = _token0;
            token1 = _token1;
            dex = _dex;
            tokenPT = _tickerQ;
            token1T = _tickerT;
        } else {
            token1 = _token0;
            tokenP = _token1;
            dex = _dex;
            tokenPT = _tickerQ;
            token1T = _tickerT;
        }
    }

    function startTrades(uint pAmt, uint tAmt) external {
         require(IERC20(tokenP).balanceOf(msg.sender) >= pAmt, 'Not enough quote currency in account');
         require(IERC20(token1).balanceOf(msg.sender) >= tAmt, 'Not enough token currency in account');
         require(SafeMath.mod(pAmt, tAmt) == 0, 'Amount of token currency and quote currency must be proportional');
         IExc(dex).deposit(pAmt, tokenPT);
         IExc(dex).deposit(tAmt, token1T);
         IExc(dex).addToken(token1T, token1);
         IExc(dex).makeLimitOrder(token1T, tAmt, SafeMath.div(pAmt, tAmt), IExc.Side.SELL);
         IExc(dex).makeLimitOrder(token1T, pAmt, SafeMath.div(pAmt, tAmt), IExc.Side.BUY);
    }

    // function depositPool(uint amt) {

    // }
}
